import React from "react";
import faqData from "./FAQData";

export default function FAQ() {

  const data = faqData.textData;
  const answers = () => {
    {item.answer.map((item, key) => (
      <p className="faq__answer__text" key={key}>
        {item}
      </p>
    ))}
  }
  return (
    <section className="faq initial__section">
      <ul className="faq__list">
        {
          data.map((item, key) => (
            <li className="faq__item" key={key}>
              <button className="faq__question">
                {item.title}
                <span className="faq__btn"></span>
              </button>
              <div className="faq__answer">
                {item.answer.map((item, key) => (
                  <p className="faq__answer__text" key={key}>
                    {item}
                  </p>
                ))}
              </div>
            </li>
          ))
        }
      </ul>
    </section>
  )
}
